import React from "react";
import { Routes, Route } from 'react-router-dom';

import Home from './pages/Home';
import Config from './pages/config';



export default () => {

    return (
        <Router>
            <Layout>
                <Routes>
                    <Route exact path="/" element={<Home />} />
                    <Route exact path="/config" element={<Config />} />
                </Routes>
            </Layout>
        </Router>
    );
}
